angular.module('screens', [
  'screenConnecting',
  'screenJukebox',
  'screenLoading',
  'screenPlaylist',
  'screenProfile',
  'screenSocial',
  'animations',
  'scrollableArea'
]);

angular.module('sjApp', [
  'appState',
  'device',
  'profile',
  'screens'
])
  .config([
    function() {
    }
  ])
  .run(['$document', 'appService',
    function($document, appService) {
      setTimeout( function() {
        $document.trigger("deviceready");
      }, 500);

      $document.on("deviceready", function() {
        appService.startInitializing();
      });
    }
  ])
  ;

angular.module('sjApp')
  .controller('screenController', ['$scope', 'appState', 'appService', 'animations', "$timeout",
    function($scope, appState, appService, animations, $timeout) {

      $scope.$watch(
        function() { return appState.wifiState; },
        function(newValue, oldValue) {
          if (newValue === false) {
            // TODO: go to searchBarsScreen
          } else if (newValue === true) {
            appService.getAvailableConnections()
              .then(function(list) {
                if (list.length === 0) {
                  // TODO: go to noBarsScreen
                  return;
                }

                // TODO:
                // check if is any bar
                //   if(no): go to noBarsScreen
                //   else:
                //     if(is connected already to a bar):
                //       go to profileScreen
                //     if(is only a bar):
                //       connect directly
                //       go to profileScreen
                //     else:
                //       go to barsScreen

                // JUNK
                angular.copy(list, appState.availableBars);
                animations("fromLoadingScreenToBarsScreen");
              })
              ;
          }
        }
      );
    }
  ])
  ;

angular.module('sjApp')
  .service('appService', ['device', 'appState', '$q', 'animations',
    function(device, appState, $q, animations) {
      var $app = this;

      $app.startInitializing = function() {
        device.getWifiState()
          .then(function(state) {
            appState.wifiState = state;
          })
          ;
      };

      $app.getAvailableConnections = function() {
        var deferred = $q.defer();

        device.getAvailableConnections()
          .then(function(list) {
            deferred.resolve(list);
          })
          ;

        return deferred.promise;
      };

      $app.connectToBar = function(bar, element) {
        // TODO: connect to bar
        // TODO: animation
        
        animations("fromBarsScreenToProfileScreen", {barEl: element});
        
      };
    }
  ])
  ;

angular.module("animations", [])
  .config([
    function() {
    }
  ])
  .run([
    function() {
    }
  ])
